import './ExpenseItem.css'

const ExpenseItem = () => {
    return (
<div className='expenseitem'>
    <div>6 września 2022</div>
    <div>
        <h2>Rata kredytu hipotecznego</h2>
        <div>1500 zł</div>
    </div>
</div>
    )
}

export default ExpenseItem;
